    // Hashing

    function crypto_hash(bs) {
      var address = injectBytes(bs);
      var hash = new Target(nacl_raw._crypto_hash_bytes());
      check("_crypto_hash", nacl_raw._crypto_hash(hash.address, address, bs.length, 0));
      FREE(address);
      return hash.extractBytes();
    }

